import React, { Component } from 'react'
import Header from '../components/Header.js'

class CatShow extends Component{
  render(){
    return(
      <React.Fragment>
        <Header />
        <h4>Hi, { this.props.cats.name }</h4>
      </React.Fragment>
    )
  }
}
export default CatShow
